openapi: 3.0.3
info:
  title: Anonsocks
  description: ''
  version: 1.0.0
servers:
  -
    url: 'http://127.0.0.1:8000'
paths:
  /api/v1/category:
    get:
      summary: 'Список категорий'
      operationId: ''
      description: 'Получить категории проксей'
      parameters: []
      responses:
        200:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  success: true
                  message: 'Categories list'
                  data:
                    -
                      name: ipv6_64
                      available: 1
                      description: 'Lorem ipsum dolor sit amet, consectetur adip'
                      note: "I'm being held hostage"
                      rental_terms:
                        -
                          days: 1
                          price: 1
                    -
                      name: ipv4_free
                      available: 1
                      description: 'Lorem ipsum dolor sit amet, consectetur adip'
                      note: "I'm being held hostage"
                      rental_terms: []
                    -
                      name: ipv4_premium
                      available: 1
                      description: 'Lorem ipsum dolor sit amet, consectetur adip'
                      note: "I'm being held hostage"
                      rental_terms: []
                    -
                      name: bot
                      available: 1
                      description: 'this category created by bot'
                      note: lol
                      rental_terms:
                        -
                          days: 15
                          price: 5
                properties:
                  success:
                    type: boolean
                    example: true
                  message:
                    type: string
                    example: 'Categories list'
                  data:
                    type: array
                    example:
                      -
                        name: ipv6_64
                        available: 1
                        description: 'Lorem ipsum dolor sit amet, consectetur adip'
                        note: "I'm being held hostage"
                        rental_terms:
                          -
                            days: 1
                            price: 1
                      -
                        name: ipv4_free
                        available: 1
                        description: 'Lorem ipsum dolor sit amet, consectetur adip'
                        note: "I'm being held hostage"
                        rental_terms: []
                      -
                        name: ipv4_premium
                        available: 1
                        description: 'Lorem ipsum dolor sit amet, consectetur adip'
                        note: "I'm being held hostage"
                        rental_terms: []
                      -
                        name: bot
                        available: 1
                        description: 'this category created by bot'
                        note: lol
                        rental_terms:
                          -
                            days: 15
                            price: 5
                    items:
                      type: object
                      properties:
                        name:
                          type: string
                          example: ipv6_64
                        available:
                          type: integer
                          example: 1
                        description:
                          type: string
                          example: 'Lorem ipsum dolor sit amet, consectetur adip'
                        note:
                          type: string
                          example: "I'm being held hostage"
                        rental_terms:
                          type: array
                          example:
                            -
                              days: 1
                              price: 1
                          items:
                            type: object
                            properties:
                              days:
                                type: integer
                                example: 1
                              price:
                                type: integer
                                example: 1
      tags:
        - Category
      security: []
  '/api/v1/category/{category_name}/countries':
    get:
      summary: 'Список стран категории'
      operationId: ''
      description: "Получить все страны у категории\n\n<aside class=\"notice\">Используйте param `full_names` для полного отображения названий стран</aside>"
      parameters: []
      responses:
        404:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  success: false
                  message: 'Resource not found.'
                properties:
                  success:
                    type: boolean
                    example: false
                  message:
                    type: string
                    example: 'Resource not found.'
      tags:
        - Category
      security: []
    parameters:
      -
        in: path
        name: category_name
        description: ''
        example: 1
        required: true
        schema:
          type: integer
  /api/v1/deposit:
    get:
      summary: 'Список депозитов'
      operationId: ''
      description: 'Получить все депозиты юзера'
      parameters: []
      responses:
        401:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  success: false
                  message: Unauthenticated.
                properties:
                  success:
                    type: boolean
                    example: false
                  message:
                    type: string
                    example: Unauthenticated.
      tags:
        - Deposits
  '/api/v1/deposit/{internal_id}':
    get:
      summary: 'Посмотреть депозит'
      operationId: ''
      description: 'Посмотреть объект депозита'
      parameters: []
      responses:
        401:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  success: false
                  message: Unauthenticated.
                properties:
                  success:
                    type: boolean
                    example: false
                  message:
                    type: string
                    example: Unauthenticated.
      tags:
        - Deposits
    parameters:
      -
        in: path
        name: internal_id
        description: 'The ID of the internal.'
        example: 1
        required: true
        schema:
          type: integer
  /api/v1/deposit/create:
    post:
      summary: 'Создать депозит'
      operationId: ''
      description: 'Создает заявку на депозит и возращает URL coinbase оплаты'
      parameters: []
      responses: {  }
      tags:
        - Deposits
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                amount:
                  type: integer
                  description: 'Must be at least 1.'
                  example: 11
              required:
                - amount
  /api/coinbase/webhook:
    post:
      summary: ''
      operationId: postApiCoinbaseWebhook
      description: ''
      parameters: []
      responses: {  }
      tags:
        - Endpoints
      security: []
  /api/v1/admin/proxy/export:
    post:
      summary: ''
      operationId: postApiV1AdminProxyExport
      description: ''
      parameters: []
      responses: {  }
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                user_id:
                  type: string
                  description: ''
                  example: mollitia
              required:
                - user_id
      security: []
